css:
div#content{
    background-color: #F8F8F8;
}

.welcome {
    font-size: 42px;
    text-align: center;
    margin-bottom: 10px;
}

.pb-block-label{
    font-size: 24px;
    margin-top:30px;
    margin-bottom: 0px;
}

.navBlock{
display: inline-block;
}

.navBtn{
display: inline-block;
    background-color: rgb(255,255,255);
    border-bottom-color: rgb(221, 221, 221);
    border-bottom-style: solid;
    border-bottom-width: 4px;
    border-left-width: 0px;
    border-right-width: 0px;
    border-top-width: 0px;
	font-size:24px;
	font-weight:500;
    padding-top: 5px;
    padding-right: 15px;
    padding-bottom: 5px;
    padding-left: 15px;
    margin-bottom:2px;
    margin-left:5px;
    margin-right:5px;
margin-top:2px;
}


button.gen-app-tile {
    min-height: 110px;
    background-color: rgb(255,255,255);
    border-bottom-color: rgb(221, 221, 221);
    border-bottom-style: solid;
    border-bottom-width: 4px;
    border-left-width: 0px;
    border-right-width: 0px;
    border-top-width: 0px;
    padding-top: 15px;
    padding-right: 15px;
    padding-bottom: 0px;
    padding-left: 15px;
    margin-bottom:0px;
    margin-left:0px;
    margin-right:12px;
    margin-top:12px;
}

a.gen-app-tile,
a.gen-app-tile:visited,
a.gen-app-tile:hover,
a.gen-app-tile:focus,
a.gen-app-tile:active {
    color: #333 !important;
}

.tile-icon {
    float: left;
    width: 25%;
}

.gen-app-tile img {
    margin: -10px 0 0 -10px;
}

.tile-content {
    float: left;
    width: 75%;
}

.tile-title {
    text-align: left;
    font-size: 16px;
    font-weight: bold;
    padding-bottom: 10px;
}

.tile-desc {
    text-align: left;
    font-size: 14px;
}

@media screen and (max-width:568px){

div#pbid-LayoutBlock, div#pbid-ButtonBlock{
    margin-left: 0px;
}
    .gen-app-tile {
        width: 100%;
        margin-bottom: 10px;
    }
}

@media screen and (min-width: 569px) and (max-width: 767px) {

div#pbid-LayoutBlock, div#pbid-ButtonBlock{
    margin-left: 0px;
}
    .gen-app-tile {
        width: 100%;
        margin-bottom: 10px;
    }
}

@media screen and (min-width: 768px) and (max-width: 1023px) {

div#pbid-LayoutBlock, div#pbid-ButtonBlock{
    margin-left: 50px;
}
    .gen-app-tile {
        width: 310px;
    }
}

@media screen and (min-width:1024px) {

div#pbid-LayoutBlock, div#pbid-ButtonBlock{
    margin-left: 100px;
}
   .gen-app-tile {
        width: 410px;
    }
}
